/** ***************************************************************************
 * HD performance data
 */
typedef struct _DMMAmFmTunerControlCoreTypes_engHdPerformanceData
{
   /**
    * The elapsed time (in 46-ms increments) from the moment an acquisition command is received until a SIS frame with a valid CRC is received by the BBP. 
    *  
    * 
    */
   unsigned short sisFrameAcquisitionTime ;

   /**
    * The elapsed time (in 46-ms increments) from the moment an acquisition command is received until digital audio is output. 
    */
   unsigned short audioAcquisitionTime ;

   /**
    * signal to noise ratio --> cd/No
    * 
    * This value is computed by the BBP from the SNR value returned in the Get_Status response. See offset 0x69 in Table 9-10 for equations. 
    * Format is 8-bit unsigned integer
    * 
    * The SNR value (a value proportional to the carrier-to-noise ratio) from which Cd/No or C/No is calculated. 
    *  
    * The formulas are: 
    *  
    * For FM: 
    * Cd/No = [5 · log 10 (SNR / 360)] + C 
    * Where C =           51.4 for MP1 
    *           51.8 for MP2 
    *           52.2 for MP3 
    *           52.9 for MP5/MP6 
    *  
    * For AM: 
    * C/No = [10·log 10 (4306.75·(800/SNR))] + C 
    * Where C =           30 for MA1 
    *     15 for MA3 
    * 
    * (source: RX_IDD_2206 - HD Radio™ Commercial Receiver BBP Command and Data Interface Definition - Revision 09)
    */
   unsigned char signalToNoiseRatio ;

   /**
    * The duration [sec] that the BBP has been outputting analog audio. 
    */
   unsigned short analogTime ;

   /**
    * hd bit rates
    */
   DMMAmFmTunerControlCoreTypes_hdBitRates bitRates ;

   /**
    * number of blends
    */
   unsigned short blendCount ;

} DMMAmFmTunerControlCoreTypes_engHdPerformanceData ;

#define DMMAmFmTunerControlCoreTypes_engHdPerformanceData_Init( p ) memset( p, 0, sizeof(*p))
#define DMMAmFmTunerControlCoreTypes_engHdPerformanceData_Free( p ) // don't do anything

void DSIReadDMMAmFmTunerControlCoreTypes_engHdPerformanceData( DSIStream *stream, DMMAmFmTunerControlCoreTypes_engHdPerformanceData *p ) ;
