/** ***************************************************************************
 * HD status data
 */
typedef struct _DMMAmFmTunerControlCoreTypes_engHdStatusData
{
   /**
    * Indicates the FM primary service mode if the BBP is in FM reception mode or the AM service mode if the BBP is in AM reception mode. 
    * 
    * FM 
    * 0x00: Not Valid (default) 
    * 0x01: MP1 
    * 0x02: MP2 
    * 0x03: MP3 
    * 0x05: MP5 
    * 0x06: MP6 
    *  
    * AM 
    * 0x01: MA1 
    * 0x02: Not Valid (default) 
    * 0x03: MA3 
    * 
    * 
    * (source: RX_IDD_2206 - HD Radio™ Commercial Receiver BBP Command and Data Interface Definition - Revision 09)
    */
   unsigned char primaryServiceMode ;

   /**
    * 1: HD acquired
    * 0: HD not acquired
    */
   unsigned char acquisitionStatus ;

   /**
    * SIS vaild (short station name, long station name, ...)
    * 
    * 0x00: failed 
    * 0x01: passed 
    * 
    */
   unsigned char sisCrcStatus ;

   /**
    * Indicates audio acquisition status of the currently selected audio program, smoothed by the internal blending algorithm. 
    * 
    * 0x00: digital audio not acquired 
    * 0x01: digital audio acquired 
    * 
    * (source: RX_IDD_2206 - HD Radio™ Commercial Receiver BBP Command and Data Interface Definition - Revision 09)
    */
   unsigned char digitalAudioAcquired ;

   /**
    * 0x00: Blend disabled  
    * 0x01: Blend enabled  
    * 
    * Indicates whether the transmitter has applied diversity delay to the analog signal.  
    * If not, the analog audio and the digital audio are not time-aligned in the receiver. 
    *  
    * If TX Blend Enabled is true, the receiver will blend normally. The value is equal to the most significant bit of the TX Blend Control Status field (offset 0x0B). 
    *  
    * This field will always be 0x00 when a supplemental program is selected. 
    * 
    */
   unsigned char txBlendEnabled ;

   /**
    * 0x00: Codec Mode 0 
    * 0x01: Codec Mode 1 
    * 0x02: Codec Mode 2 
    * 0x03: Codec Mode 3 
    * 0x04 – 0x09: Reserved 
    * 0x0A: Codec Mode 10 
    * 0x0B – 0x0C: Reserved 
    * 0x0D: Codec Mode 13 
    * 0x0E – 0x7E: Reserved 
    * 0x7F: Not Valid (Default) 
    * 
    * Indicates the audio codec configuration for the currently selected audio program. 
    *  
    * Codec Mode Definitions: 
    * 0:   FM hybrid single-stream on P1 channel 
    * 1:   FM all digital dual-stream with mono core 
    * (typically used with MP5) 
    * 2:   AM hybrid/all digital dual-stream 
    * 3:   FM all digital dual-stream with stereo core 
    * (typically used with MP6) 
    * 10:  FM dual-stream on SPS 
    * 13:  FM hybrid/all digital single-stream on P3 
    * channel 
    */
   unsigned char codecMode ;

   /**
    * 0x00: 0 dB 0x18: -8 dB 
    * 0x01: 1 dB 0x19: -7 dB 
    * 0x02: 2 dB 0x1A: -6 dB 
    * 0x03: 3 dB 0x1B: -5 dB 
    * 0x04: 4 dB 0x1C: -4 dB 
    * 0x05: 5 dB 0x1D: -3 dB 
    * 0x06: 6 dB 0x1E: -2 dB 
    * 0x07: 7 dB 0x1F: -1 dB 
    * 0x08 – 0x17: Reserved 
    * 0x20 – 0x7F: Reserved 
    * 0x80: Not Valid (Default) 
    * 
    * Indicates the amount of audio gain for the receiver to apply to the digital audio of the currently selected program, relative to the analog audio for MPS programs or relative to other digital audio programs for SPS programs, to achieve proper blend level alignment. 
    *  
    * In 5-bit two’s complement format. 
    *  
    * TX Digital Audio Gain is ONLY valid when Digital Audio Acquired = 1.  
    *  
    * This value is applied automatically within the BBP if the analog AM/FM service is available within the BBP.  
    *  
    * If this value is applied within the BBP, then a received value of +7 dB will only be adjusted by 6 dB. 
    */
   unsigned char txDigitalAudioGain ;

   /**
    * Bit 0,1: see TX Blend Control Bits Definition [HD Radio™ Commercial Receiver Baseband Processor Command and Data Interface Definition]
    */
   unsigned char txBlendCtrlStatus ;

   /**
    * This is the same information that is returned in the Get_QI command response LM. (Refer to Table 5-1, opcode 0x21.) 
    *  
    * This value indicates the quality of the currently selected audio program. By default, it reflects the quality of MPS audio until SPS audio is selected. 
    * 
    * 8-bit integer 
    *  
    * Byte 0: QI value from 0x00 to 
    * 0x0F, where 0x00 is the lowest 
    * audio quality (no digital audio 
    * available) and 0x0F is the best 
    * digital audio quality.  
    * 
    * (source: RX_IDD_2206 - HD Radio™ Commercial Receiver BBP Command and Data Interface Definition - Revision 09)
    */
   unsigned short qualityIndicator ;

   /**
    * Bit Mask:
    * Bit 0: MPS; Bit1: SPS1; Bit2: SPS2; Bit3: SPS3; Bit4: SPS4; Bit5: SPS5; Bit6: SPS6; Bit7: SPS7
    * 
    * e.g.: serviceNo = 4 --> SPS2 active
    */
   unsigned char serviceNumber ;

   /**
    * Bit 0:  0=BGM inactive; 1=BGM active
    * 
    * Bit 1: BGM config:  0=audio digital; 1=audio analog 
    */
   unsigned char ballGameMode ;

   /**
    * tagging readiness 
    * range: 0=not ready; 1=ready
    */
   unsigned char taggingReadiness ;

} DMMAmFmTunerControlCoreTypes_engHdStatusData ;

#define DMMAmFmTunerControlCoreTypes_engHdStatusData_Init( p ) memset( p, 0, sizeof(*p))
#define DMMAmFmTunerControlCoreTypes_engHdStatusData_Free( p ) // don't do anything

